  \"Prime Hook National Wildlife Refuge Fire Management Plan and EA for 2009\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:14.526168\",\n\t\"name\": \"prime-hook-national-wildlife-refuge-fire-management-plan-and-ea-for-2009\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This FMP meets new Department of Interior
  (DOI) and United States Fish and Wildlife Service (USFWS) requirements that every
  area with burnable vegetation has approved site-specific fire management operational
  guidelines, descriptions of refuge wildland vegetation types, their fuel models
  and fire characteristics. Since this plan is significantly different from the 2002
  FMP because it addresses new refuge-specific Wildland-Urban Interface (WUI) problems
  on Prime Hook National Wildlife Refuge (PHNWR), an EA was necessary to evaluate
  impacts for significant fire management changes in the new plan.  The 2009 plan
  updates the 2002 FMP by incoporating new interagency and USFWS fire management policies
  and procedures. Important values to protect include the endangered Delmarva Fox
  Squirrel (DFS) and newly identified Wildland-Urban Interface areas on the refuge
  that directly impact three beachfront communities from refuge-based Phragmites hazardous
  fuels. In 1986, the endangered DFS was re-introduced to the refuge. The refuge's
  DFS population is a successful one and will likely be the core for expanding DFS
  habitats in the coming years. Prescribed Fire can improve and enhance DFS habitats.
  Other keystone wildlife habitats and priority resources of concern on PHNWR, that
  would greatly benefit from Prescribed Fire (Rx), are also described. In recent years
  (2002-2008), a significant awareness of WUI issues on federal lands has occurred
  on the east coast. This is especially true for PHNWR where three beachfront communities
  lie just east of refuge lands and have been identified as WUI Communities at FIRE
  RISK. As a result of added emphasis on WUI issues this FMP includes a refuge-specific
  WUI Monitoring Plan and WUI Sampling Protocols that will tract Phragmites Spray
  Zones within \"Limtied Tolerance\" and \"Zero Tolerances\" areas for Phrgamites
  related to high fire risk for these communities.\",\n\t\"license_title\": \"License
